// src/components/ProfileUpdate.js

import React, { useState } from 'react';
import { updateProfile } from '../services/api';

const ProfileUpdate = ({ token }) => {
  const [profileData, setProfileData] = useState({
    name: '',
    email: '',
    mobile: '',
    dob: '',
    gender: '',
    address: '',
  });

  const [message, setMessage] = useState('');
  const [error, setError] = useState('');

  const handleChange = (e) => {
    setProfileData({
      ...profileData,
      [e.target.name]: e.target.value,
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await updateProfile(token, profileData);
      setMessage(response.message);
      setError('');
    } catch (err) {
      setError(err.detail || 'Error updating profile');
      setMessage('');
    }
  };

  return (
    <div>
      <h2>Update Profile</h2>
      <form onSubmit={handleSubmit}>
        {/* Form fields */}
        <input type="text" name="name" placeholder="Name" onChange={handleChange} />
        <input type="email" name="email" placeholder="Email" onChange={handleChange} />
        <input type="text" name="mobile" placeholder="Mobile" onChange={handleChange} />
        <input type="date" name="dob" onChange={handleChange} />
        <select name="gender" onChange={handleChange}>
          <option value="">Select Gender</option>
          <option value="Male">Male</option>
          <option value="Female">Female</option>
          <option value="Other">Other</option>
        </select>
        <textarea name="address" placeholder="Address" onChange={handleChange}></textarea>
        <button type="submit">Update Profile</button>
      </form>
      {message && <p>{message}</p>}
      {error && <p style={{ color: 'red' }}>{error}</p>}
    </div>
  );
};

export default ProfileUpdate;
